=========================================================
* Soft UI Dashboard PRO React - v2.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/soft-ui-dashboard-pro-material-ui
* Copyright 2021 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

// @mui material components
import Grid from "@mui/material/Grid";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
// import AnimatedStatisticsCard from "examples/Cards/StatisticsCards/AnimatedStatisticsCard";

// import AnnouncementCard from "examples/Cards/AnnouncementCard";
// import ProgressLineChart from "examples/Charts/LineCharts/ProgressLineChart";
// import ProgressDoughnutChart from "examples/Charts/DoughnutCharts/ProgressDoughnutChart";

// General page components
// import TodoList from "layouts/pages/projects/general/components/TodoList";

// Data
// import progressLineChartData from "layouts/pages/projects/general/data/progressLineChartData";
// import progressDoughnutChartData from "layouts/pages/projects/general/data/progressDoughnutChartData";

// Images
// import team3 from "assets/images/team-3.jpg";



import { Table } from 'react-bootstrap';

function General() {



  return (
    <DashboardLayout>
      <DashboardNavbar />
      <SuiBox mt={3}>
        <Grid container spacing={3}>   
          <Grid item xs={12} md={10} lg={12} py={3}>
            <Grid item xs={15} lg={12}>
              <SuiBox mb={3}>
              <Table striped bordered hover size="sm" style={{ textAlign: "center" }}>
                <thead>
                  <tr>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}><a href="/rtasip/amcwisesip">AMC Wise SIP </a></th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}><a href="/rtasip/schemewisesip">Scheme Wise SIP </a></th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}><a href="/rtasip/clientwisesip">Client Wise SIP</a></th>
                    <th style={{ padding: "15px", borderColor: 'white', width: '200px' }}><a href="/rtasip/sipstartedlastmonth">SIP Maturing in 1 Month</a></th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}>SIP Started in last 1 Month</th>
                  </tr>
                </thead>
              </Table>
              <br/>

                <Table striped bordered hover size="sm" style={{ textAlign: "center", borderColor: 'black' }}>
                  <thead>
                  <tr>
                    <th style={{  backgroundColor: "rgb(249, 221, 171)", padding: "15px"}}>Client Name</th>
                    <th style={{  backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>Pan Number</th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px"}}>SIP Amount</th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px"}}>No Of SIPS</th>
                  </tr>
                  </thead>
                  {/* <br/> */}
                  <tbody>
                  <tr>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" , padding:'10px'}}>Total</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>Nill</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>0</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>0</td>
                  </tr>
                  </tbody>
                </Table>
              </SuiBox>
            </Grid>
          </Grid>
        </Grid>
      </SuiBox>
      <Footer />
    </DashboardLayout>
  );
}

export default General;
